import { useState } from "react";
import { menuItems } from '../../internalApi/menuApi'
import './NavBar'

export default function NavBar() {

    const [item, setItem] = useState("") // item do menuApi

    const navBarItems = menuItems.map(a => a.item)

    const [open, setOpen] = useState(false)

    return (
        <div>
            <ul>
                {
                    navBarItems.map((i, a) => (
                        <li key={i.id}>
                            {a}
                        </li>
                    ))
                }
            </ul>
        </div>
    )
}
